import { unlink } from 'fs';

class App extends Component{

  componentDidMount() {
    fetch('http://84.88.185.94:5002/graph/a22l')
    .then(res => res.json())
    .then((data) => {
      this.setState({ contacts: data })
    })
    .catch(console.log)
  }

  state = {
    contacts: []
  }

  render() {
    return (
      <div class="card">
        <div className="card-body">
          <h5 className="card-title">Steve Jobs</h5>
          <h6 className="card-subtitle mb-2 text-muted">steve@com.com</h6>
          <p className="card-text">Stay card text</p>
        </div>
      </div>
    );
  }
}

export default App;
